(24, 12, 'wsg_courseInfo_items_texto', '<div>\r\n<div>Apresentar conceitos, modelos e ferramentas com objetivo de consolidar conhecimentos de gestão de negócios e marketing, por meio de uma perspectiva holística e moderna, que habilite os participantes a atuarem na área de marketing, em empresas de diferentes portes, setores e estágios de desenvolvimento.</div>\r\n<div>Busca-se privilegiar elevado conhecimento técnico que conduza a uma eficiente performance do profissional de marketing, bem como o desenvolvimento de competências compatíveis com a filosofia de foco no mercado, na ética e na responsabilidade.</div>\r\n<div></div>\r\n<div>Ao final do curso, o aluno será capaz de compreender as diferentes áreas da atividade de marketing, suas inter-relações e o papel do marketing como suporte à estratégia.</div>\r\n</div>'),
(25, 12, 'wsg_courseInfo_texto', 'O Curso de Odontologia do UniGoyazes com duração de 4 anos, segue as Diretrizes Nacionais para formar cirurgiões dentistas generalistas, humanistas, críticos e reflexivos. A formação é baseada em rigor técnico e científico, princípios éticos e legais, e considera a realidade social, cultural e econômica do meio em que atuam. O objetivo é formar profissionais que possam transformar a realidade em benefício da sociedade.\r\n\r\n&nbsp;\r\n\r\n<strong>VOCÊ PODERÁ CONCILIAR TEORIA E PRÁTICA NA CLÍNICA ESCOLA DA UNIGOYAZES, QUE OFERECE ATENDIMENTO À COMUNIDADE LOCAL.</strong>'),
