(58, 12, 'wsg_box_ancora_titulo01', 'SOBRE O CURSO'),
(59, 12, 'wsg_txt_box_ancora01', 'O <strong>Curso de Odontologia da UniGoyazes</strong> com duração de 4 anos, segue as Diretrizes Nacionais para formar <strong>cirurgiões dentistas generalistas, humanistas, críticos e reflexivos.</strong>\r\n\r\n&nbsp;\r\n\r\nA formação é baseada em rigor técnico e científico, princípios éticos e legais, e considera a realidade social, cultural e econômica do meio em que atuam. O objetivo é formar <strong>profissionais que possam transformar a realidade</strong> em benefício da sociedade.\r\n\r\n&nbsp;\r\n\r\nO objetivo da formação do <strong>Cirurgião Dentista</strong> é proporcionar ao profissional os conhecimentos necessários para desenvolver as competências e habilidades gerais, tais como:'),
(60, 12, 'wsg_box_ancora_lista', 'a:6:{i:0;s:150:\"a) Atenção à saúde em todos os níveis, ou seja, tanto na prevenção das doenças quanto no tratamento das mesmas em menor ou maior complexidade;\";i:1;s:105:\"b) Tomada de decisões quanto ao melhor tratamento em cada caso, baseando-se em evidências científicas;\";i:2;s:294:\"c) Comunicação, em linguagem verbal, não verbal (Ex: linguagem corporal do paciente), escrita e leitura. Isso inclui confidencialidade de informações do paciente, o domínio de pelo menos uma língua estrangeira, linguagem de tecnologias de comunicação e informação (Ex: computadores);\";i:3;s:14:\"d) Liderança:\";i:4;s:35:\"e) Administração e gerenciamento;\";i:5;s:122:\"f) Educação permanente, com leitura/estudo de livros e artigos científicos, participação em cursos e congressos, etc;\";}'),
(63, 12, 'wsg_box_ancora_titulo02', 'MATRIZ CURRICULAR - BACHARELADO'),
(65, 12, 'faq_items', 'a:1:{i:0;a:2:{s:31:\"wsg_box_ancora02_items_tituloAc\";s:5:\"Teste\";s:30:\"wsg_box-ancora02_items_textoAc\";s:5:\"Testo\";}}'),
(66, 12, 'box_ancora02_items', 'a:3:{i:0;a:2:{s:31:\"wsg_box_ancora02_items_tituloAc\";s:14:\"OBRIGATÓRIAS:\";s:30:\"wsg_box-ancora02_items_textoAc\";s:1832:\"Anatomia Dental e Oclusão – 80h\r\nAnatomia, Cabeça e Pescoço – 80h\r\nAnestesiologia Odontológica e Primeiros Socorros – 80h\r\nCariologia e Saúde Pública – 80h\r\nCiências Administrativas e Gerenciais – 80h\r\nCiências Bioexatas – 80h\r\nCiências Humanas e Sociais – 80h\r\nCiências Morfofuncionais Fisiológicas – 80h\r\nCiências Morfofuncionais Músculo-Esqueleticas – 80h\r\nCiências Morfofuncionais Sistêmicas – 80h\r\nCiências Químicas – 80h\r\nCirurgia e Traumatologia Buco-Maxilo I – 80h\r\nCirurgia e Traumatologia Buco-Maxilo II / Implantodontia – 80h\r\nCirurgia Oral – 80h\r\nCitologia, Histologia e Embriologia Aplicada à Odontologia – 80h\r\nClínica Infantil I – 80h\r\nClínica Infantil II – 80h\r\nClínica Integrada I – 80h\r\nClínica Integrada II – 80h\r\nClínica Integrada III – 80h\r\nContabilidade e Plano de Negócios – 80h\r\nDentística I – 80h\r\nDentística II – 80h\r\nDiagnóstico Bucal – 80h\r\nEmpreendedorismo – 80h\r\nEndodontia I – 80h\r\nEndodontia II – 80h\r\nEpidemiologia e Saúde Pública – 80h\r\nEstágio Extra-Muro I – 80h\r\nEstágio Extra-Muro II – 80h\r\nFarmacologia Aplicada à Odontologia – 80h\r\nFarmacologia Geral – 80h\r\nFormação Profissional e Ética em Odontologia – 80h\r\nIntrodução à Dentistica – 80h\r\nIntrodução à Reabilitação Oral – 80h\r\nLibras – 80h\r\nMicrobiologia e Imunologia – 80h\r\nOdontologia Legal – 80h\r\nOdontopediatria I – 80h\r\nOptativa – 80h\r\nOrtodontia – 80h\r\nPatologia Bucal – 80h\r\nPeriodontia I – 80h\r\nPeriodontia II – 80h\r\nPsicologia e Sociologia Aplicada à Saúde – 80h\r\nRadiologia Odontológica – 80h\r\nReabilitação Oral I – 80h\r\nReabilitação Oral II – 80h\r\nSeminário de Pesquisa – 80h\r\nSemiologia e Estomatologia Odontológica – 80h\r\nTCC – 80h\r\nUrgência I – 80h\r\nUrgência II – 80h\";}i:1;a:2:{s:31:\"wsg_box_ancora02_items_tituloAc\";s:10:\"OPTATIVAS:\";s:30:\"wsg_box-ancora02_items_textoAc\";s:110:\"Língua Brasileira de Sinais (LIBRAS) – 80h\r\nOdontologia do Trabalho – 80h\r\nOdontologia Hospitalar – 80h\";}i:2;a:2:{s:31:\"wsg_box_ancora02_items_tituloAc\";s:15:\"COMPLEMENTARES:\";s:30:\"wsg_box-ancora02_items_textoAc\";s:91:\"Atividades Complementares – 200h\r\n\r\n<strong>CARGA HORÁRIA TOTAL DO CURSO</strong>: 4400h\";}}'),
(67, 12, 'wsg_box_ancora_titulo03', 'PERFIL DO EGRESSO'),
(68, 12, 'wsg_txt_box_ancora03', '<strong>O curso de Odontologia</strong> da UniGoyazes <strong>baseia-se</strong>, essencialmente,<strong> na humanização das relações entre pacientes, alunos, professores e servidores, seguindo princípios éticos de respeito, colaboração, responsabilidade e atenção mútua</strong>. Essa premissa requer uma visão global do indivíduo como um conjunto fatores/experiências emocionais, psicológicas, fisiológicas, sociais e culturais.\r\n\r\nCom relação ao paciente e a prevenção/recuperação da saúde, busca-se entender a doença como algo mais amplo, sendo “um estado de razoável harmonia entre o sujeito e a sua própria realidade” (Segre &amp; Ferraz, Rev. Saúde Pública, vol. 31, n. 5, p.538-42, 1997; disponível em: http://dx.doi.org/10.1590/S0034-89101997000600016 ) desta forma, a responsabilidade da atenção à saúde não se encerra com o ato técnico, mas sim, com a resolução do problema de saúde, tanto em nível individual como coletivo.\r\n\r\nPor fim, o curso segue o princípio da Odontologia Baseada em Evidências Científicas (Evidence Based Dentistry), que é uma abordagem de cuidados em saúde bucal que requer a integração judiciosa entre a avaliação sistemática das evidências científicas com relevância clínica, relativas à condição e à história bucal e médica dos pacientes, com a experiência clínica do dentista e com as necessidades de tratamento dos pacientes e suas preferências (ADA – Center for Evidence-Based Dentistry: Glossary of terms). Odontologia baseada em evidências não se retringe apenas a fornecer suporte a processos de decisão sobre tratamentos de pacientes individuais, mas também fornece suporte ao planejamento, gerenciamento e avaliação de serviços odontológicos, assim como para tomar decisões sobre programas de promoção ou prevenção da saúde bucal, tanto no nível do paciente individual como em saúde pública (Fedorowicz, Z. &amp; Fedorowicz, H.(2005). Evidence based healthcare. What are the limitations of its application and implementation in dentistry?. Braz J Oral Sci. 4(13):757-75).\r\n\r\n<strong>Áreas de Atuação:</strong>\r\n<ul>\r\n 	<li>Assistência: desenvolver ações de prevenção, promoção, proteção e reabilitação da saúde, tanto em nível individual quanto coletivo. Ex: atendimento em clínicas privadas e serviços públicos de saúde; elaboração e/ou participação em atividades de educação em saúde bucal, individual ou coletiva, coordenadas ou não com a administração pública; acompanhamento e fiscalização de programas de prevenção e recuperação da saúde bucal, como fluoretação da água de abastecimento.</li>\r\n 	<li>Docência: desenvolver atividades de ensino em cursos de Odontologia de nível médio/técnico e superior.</li>\r\n 	<li>Gestão: coordenação de serviços em nível privado e público. Ex: Clínicas Privadas, Secretarias de Saúde, Unidades Básicas de Saúde, Equipes da ESF – Estratégia Saúde da Família.</li>\r\n 	<li>Pesquisa: participar de investigações científicas sobre doenças e saúde bucal e estar preparado para aplicar os resultados de pesquisas para os cuidados de saúde.</li>\r\n</ul>'),
(69, 12, 'wsg_box_ancora_titulo04', 'CERTIFICADO'),
(70, 12, 'wsg_txt_box_ancora04', 'O aluno de <strong>Odontologia da UniGoyazes pode se orgulhar de formar-se na MELHOR ESCOLA GOIANA DE SAÚDE.</strong> Com uma formação completa, o egresso poderá atuar em diversas áreas, como a clínica geral, ortodontia, periodontia, endodontia, odontopediatria, implantodontia, entre outras especialidades.\r\n\r\n&nbsp;\r\n\r\nAlém disso, <strong>o mercado de trabalho para o dentista é bastante amplo</strong>, podendo atuar em consultórios, hospitais, clínicas, empresas, universidades, além de ter a possibilidade de empreender em seu próprio consultório.\r\n\r\n&nbsp;\r\n\r\nO <strong>diploma da UniGoyazes é um diferencial</strong> importante para o <strong>sucesso profissional</strong> na área odontológica em Goiás e em todo o Brasil.'),
